import { useState,useEffect } from "react";

const[add,setAdd]=useState
function AddCart(){
    useEffect(() => {
        fetch("http://localhost:3006/Data")
            .then((res) => {
                return res.json()
            }).then((resp) => {
                setAdd(resp)
            })
    })
    return(
        <div>

        </div>
    )
}
export default AddCart;
